import React, { Component } from 'react';
import Input from './Input';

export default class AddCanteen {
    render() {
        return (
            <div>
                <Input name="name" handleChange={this.props.handleChange} />
                <Input name="description" handleChange={this.props.handleChange} />
                <Input name="image" handleChange={this.props.handleChange} />
            </div>
        );
    };
}
